import { useEffect, useState } from 'react';
import './addlist.css'; // Import your custom CSS file

const AddList = () => {
    const [postData1, setPostData1] = useState([]);

      useEffect(() => {
        fetchData();
      }, []);
    
      const fetchData = async () => {
        try {
          const response = await fetch('http://localhost:8000/getall',  
          {
            method: "GET",
          headers: {
              "Content-type": "application/json"},

              
          });
        // console.log(setPostData1)
        const data = await response.json();
        setPostData1(data);

        } catch (error) {
          console.log(error);
          alert('An error occurred while fetching post data.');
        }
      };
     
return (
    <div className="user-details-form">
    
        <div className="user-profile">
          <h3>User Profile</h3>
          <p><strong>Username:</strong> {postData1.user_name}</p>
          <p><strong>Email:</strong> {postData1.email}</p>
          {/* Display the profile photo if available */}
          {postData1.profile_photo && (
            <img src={URL.createObjectURL(postData1.profile_photo)} alt="Profile" />
          )}
        </div>
    
    </div>
  );
};

export default AddList;
